private List<S3ObjectSummary> filterSummaries(
    List<S3ObjectSummary> summaries) {
  List<S3ObjectSummary> outputList = new ArrayList<>();
  for (S3ObjectSummary s : summaries) {
    String key = s.getKey();
    if (!isKeyDelayed(delayedPutKeys.get(key), key)) {
      outputList.add(s);
    }
  }
  return outputList;
}
